import React, { Component } from 'react';
import { Pagination, PaginationItem, PaginationLink } from 'reactstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAngleDoubleLeft, faAngleLeft, faAngleRight, faAngleDoubleRight } from '@fortawesome/free-solid-svg-icons';

class ObjPag extends Component {

    Action(e){

        console.log(e);
    }

    render(){
        return (
            <Pagination>
                <PaginationItem >
                    <PaginationLink first value="atras" onClick={this.Action.bind(this, 'COSTOS')}>
                        <FontAwesomeIcon  icon={faAngleDoubleLeft} />
                    </PaginationLink>
                </PaginationItem>
                <PaginationItem >
                    <PaginationLink previous onClick={this.Action.bind("1atras")}>
                        <FontAwesomeIcon  icon={faAngleLeft} />
                    </PaginationLink>
                </PaginationItem>
                <PaginationItem active>
                    <PaginationLink onClick={this.Action.bind("1")}>
                                1
                    </PaginationLink>
                </PaginationItem>
                <PaginationItem >
                    <PaginationLink first onClick={this.Action.bind("adelante")}>
                        <FontAwesomeIcon  icon={faAngleRight} />
                    </PaginationLink>
                </PaginationItem>
                <PaginationItem >
                    <PaginationLink previous onClick={this.Action.bind("adelante1")}>
                        <FontAwesomeIcon  icon={faAngleDoubleRight} />
                    </PaginationLink>
                </PaginationItem>
            </Pagination>
        );
    }
}

export default ObjPag;
